import{_ as e,o as a,c as i,a as t}from"./app.57a3dbd1.js";const b=JSON.parse('{"title":"测试套件","description":"","frontmatter":{"contributors":["ZhouYixun"]},"headers":[{"level":2,"title":"设备覆盖与用例覆盖","slug":"设备覆盖与用例覆盖","link":"#设备覆盖与用例覆盖","children":[]},{"level":2,"title":"用例配置","slug":"用例配置","link":"#用例配置","children":[]},{"level":2,"title":"设备配置","slug":"设备配置","link":"#设备配置","children":[]},{"level":2,"title":"性能采集","slug":"性能采集","link":"#性能采集","children":[{"level":3,"title":"iOS","slug":"ios","link":"#ios","children":[]},{"level":3,"title":"安卓","slug":"安卓","link":"#安卓","children":[]}]},{"level":2,"title":"机器人通知","slug":"机器人通知","link":"#机器人通知","children":[]}],"relativePath":"doc/doc-suite.md","lastUpdated":1716537034000}'),l={name:"doc/doc-suite.md"},s=t('<h1 id="测试套件" tabindex="-1">测试套件 <a class="header-anchor" href="#测试套件" aria-hidden="true">#</a></h1><p>本页是配置测试套件教学。</p><h2 id="设备覆盖与用例覆盖" tabindex="-1">设备覆盖与用例覆盖 <a class="header-anchor" href="#设备覆盖与用例覆盖" aria-hidden="true">#</a></h2><p>用例覆盖即为每个用例只分配一个设备，设备覆盖即为每个设备都会执行所有用例。</p><p>例：选择了用例A与用例B，选择了设备1，设备2，设备3。</p><p>用例覆盖 --&gt; 随机设备运行用例A和用例B，共运行了 2 次。</p><p>设备覆盖 --&gt; 所有设备都运行了两个用例，共运行了 6 次。</p><h2 id="用例配置" tabindex="-1">用例配置 <a class="header-anchor" href="#用例配置" aria-hidden="true">#</a></h2><p>在用例列表中选择你需要运行的用例，然后可以在列表中拖拽排序，运行时将按照这个顺序进行测试。</p><div class="warning custom-block"><p class="custom-block-title">注意</p><p>当列表中的测试用例在用例页面删除后，会自动从本列表中移除。</p></div><h2 id="设备配置" tabindex="-1">设备配置 <a class="header-anchor" href="#设备配置" aria-hidden="true">#</a></h2><p>选择需要运行的设备。</p><div class="tip custom-block"><p class="custom-block-title">触发控件运行时</p><ol><li>当无设备空闲时，套件跳过执行</li><li>当用例列表为空时，套件跳过执行</li><li>当设备列表为空时，套件跳过执行</li></ol></div><h2 id="性能采集" tabindex="-1">性能采集 <a class="header-anchor" href="#性能采集" aria-hidden="true">#</a></h2><p>设置性能采集的开关与采集间隔。</p><h3 id="ios" tabindex="-1">iOS <a class="header-anchor" href="#ios" aria-hidden="true">#</a></h3><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>该功能仅在v2.1.0后可用</p></div><p>iOS通过 <a href="https://sonic-cloud.cn/sib/sib-perf.html" target="_blank" rel="noreferrer">sib perfmon</a> 进行性能采集。</p><h3 id="安卓" tabindex="-1">安卓 <a class="header-anchor" href="#安卓" aria-hidden="true">#</a></h3><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>该功能仅在v2.2.0后可用</p></div><p>安卓通过 <a href="https://sonic-cloud.cn/sas/re-sas.html" target="_blank" rel="noreferrer">sas perfmon</a> 进行性能采集。</p><h2 id="机器人通知" tabindex="-1">机器人通知 <a class="header-anchor" href="#机器人通知" aria-hidden="true">#</a></h2><p>当项目已配置通知机器人时，套件执行结果将通过机器人发送通知。</p>',23),r=[s];function c(d,n,o,h,p,u){return a(),i("div",null,r)}const f=e(l,[["render",c]]);export{b as __pageData,f as default};
